//mask the input based on the value of movies
//pwede pa to ma SIMD
int fma(string user, string movie){
    int sum = 0;
    for(int i=0;i<20;i++){
        if(movies[movie][i]!=0)
            sum += userx10000[user][i] * movies[movie][i];
    }
    return sum;
}

int main(){
    //the decimal is only 4 decimals, can multiply by 1000
    //para walang precision error
    typedef pair<int, string> P;
    priority_queue<P, vector<P>, greater<P> >pq; 
    string input; cin>>input;

    for(auto i: movieTitles){
        cout<<i<<" "<<fma(input, i)<<endl;
        pq.push({-fma(input, i), i});
    }

    for(int i=0;i<10;i++){
        cout<<pq.top().second<<endl;
        pq.pop();
    }

    return 0;
}